INSERT INTO `mdl_page` VALUES (1,2,'Prüfungsstoff 1. Prüfung','<p>Prüfungsstoff 1. Prüfung</p>',1,'<p style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\"><strong>Prüfungsstoff:</strong></p>\n<ul style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\">\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Theorie und Beispiele Betriebssysteme, Nutzungsrechte an Software</li>\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Lehrmittel Kapitel Teil A (S. 13 - 36)</li>\n</ul>\n<p style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\"><strong>Lernziele:</strong></p>\n<ul style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\">\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie kennen die Grundbegriffe, die Aufgaben, den Aufbau und die Wechselwirkung des Betriebssystems.</li>\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie kennen Beispiele moderner Betriebssysteme und können Vor- und Nachteile abwägen.</li>\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie kennen Open-Source und Closed-Source Software, deren Vor- und Nachteile und können den Einsatzzweck bestimmen.</li>\n</ul>\n<p style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\"><strong>Hilfsmittel:</strong></p>\n<ul style=\"color: #000000; font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #fafafa;\">\n<li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">ausgedruckte Konsolebefehlsliste aus Klassenwiki</li>\n</ul>',1,2,NULL,5,'a:1:{s:10:\"printintro\";s:1:\"0\";}',2,1393419659),(2,2,'1. Prüfung','',1,'1. Prüfung',2,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1329928960),(3,2,'Frühlingsferien','',1,'Frühlingsferien ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1331909828),(4,2,'Frühlingsferien','',1,'Frühlingsferien ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1331909842),(5,2,'Prüfungsstoff 2. Prüfung (ISN2A)','',1,'\n<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Prüfungsstoff:</strong></p>\n<ul>\n  <li>Lehrmittel Teil B (Kapitel 4 - 7)</li>\n  <li>Kapitel 12<br /></li>\n</ul>\n<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Lernziele:</strong></p>\n<ul style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\">\n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie kennen den Aufbau einer Festplatte und können die Partitionierung vornehmen und erklären. Weiter kennen Sie verschiedene Dateisysteme und deren Vor- und Nachteile.</li>\n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie können den Installationsumfang festlegen und kennen die wichtigsten Tools dazu. Weiter kennen Sie verschiedene Programme für die einzelnen Betriebssysteme.<br /></li>\n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie können als Administrator arbeiten und grundlegende Konfigurationen vornehmen. Sie beherrschen dabei die Konsole und können die wichtigsten Befehle anwenden.<br /></li>\n</ul>\n<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Hilfsmittel:</strong></p> ausgedruckte Konsolebefehlsliste aus Klassenwiki ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1336368879),(6,2,'Prüfungsstoff 2. Prüfung (IAN2A, IAN2B, ISI2)','',1,'<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Prüfungsstoff:</strong></p> \n<ul> \n  <li>Lehrmittel Teil B (Kapitel 4 - 7)</li> \n  <li>Kapitel 12<br /></li> \n</ul> \n<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Lernziele:</strong></p> \n<ul style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"> \n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie kennen den Aufbau einer Festplatte und können die Partitionierung vornehmen und erklären. Weiter kennen Sie verschiedene Dateisysteme und deren Vor- und Nachteile.</li> \n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie können den Installationsumfang festlegen und kennen die wichtigsten Tools dazu. Weiter kennen Sie verschiedene Programme für die einzelnen Betriebssysteme.<br /> </li> \n  <li style=\"font-family: arial,verdana,helvetica,sans-serif; font-size: 16px;\">Sie können als Administrator arbeiten und grundlegende Konfigurationen vornehmen. Sie beherrschen dabei die Konsole und können die wichtigsten Befehle anwenden.<br /></li> \n</ul> \n<p style=\"color: rgb(0, 0, 0); font-family: arial,verdana,helvetica,sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: rgb(250, 250, 250);\"><strong>Hilfsmittel:</strong></p> ausgedruckte Konsolebefehlsliste aus Klassenwiki ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1336368891),(7,2,'Repetiton Modul 101','',1,'Repetiton Modul 101 für Modulprüfung ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1338362059),(8,2,'Modulprüfungs- und Exkursionswoche','',1,'Modulprüfungs- und Exkursionswoche ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1337933348),(9,3,'Prüfungsstoff 1. Prüfung','',1,'<div class=\"box generalbox generalboxcontent boxaligncenter clearfix\"> \n  <p><strong>Prüfungsstoff:</strong></p> \n  <ul> \n    <li>Grundlagen (Windows-Explorer, Lokale Benutzerverwaltung, Dateien und Ressourcen freigeben</li> \n    <li>Grundlagen Word (Formatierungen), Umbrüche, Spalten, Kopf- und Fusszeilen<br /></li> \n    <li>Lehrmittel Kapitel 1 - 5 (S. 6 - 47) </li> \n  </ul> \n  <p><strong>Lernziele:</strong></p> \n  <ul> \n    <li>Sie kennen den Windows-Explorer und können diesen anwenden.<br /></li> \n    <li>Sie kennen die Konzepte der Benutzerverwaltung, die Theorie der Freigaben und wissen was ein Dateisystem ist. </li> \n    <li>Sie können Zeichen, Absätze und Seiten unterschiedlich formatieren.<br /></li> \n    <li>Sie können mit Spalten, Kopf- und Fusszeilen in Word arbeiten</li> \n    <li>Sie kennen die Möglichkeiten der verschiedenen Umbrüche und können diese anwenden.<br /></li> \n  </ul> \n  <p><strong>Hilfsmittel:</strong></p> \n  <ul> \n    <li>keine</li> \n  </ul></div> ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1345621362),(10,3,'Vorschau Lösung Umzugsplan','',1,'<img src=\"data:image/png;base64,\" /> ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1347428162),(11,3,'Prüfungsstoff 2. Prüfung','',1,'\n<div class=\"box generalbox generalboxcontent boxaligncenter clearfix\">\n  <div class=\"box generalbox generalboxcontent boxaligncenter clearfix\">\n    <p><strong>Prüfungsstoff:</strong></p>\n    <ul>\n      <li>Grundlagen Word (Formatierungen), Umbrüche, Spalten, Kopf- und Fusszeilen</li>\n      <li>Formatvorlagen</li>\n      <li>Weiterführende Textgestaltung, Tabellen</li>\n      <li>Illustrationen<br /></li>\n      <li>Lehrmittel Kapitel 4 - 8, 10 (S. 28 - 75 und S. 86 - 91) </li>\n    </ul>\n    <p><strong>Lernziele:</strong></p>\n    <ul>\n      <li>Sie können Zeichen, Absätze und Seiten unterschiedlich formatieren.<br /></li>\n      <li>Sie können mit Spalten, Kopf- und Fusszeilen in Word arbeiten</li>\n      <li>Sie kennen die Möglichkeiten der verschiedenen Umbrüche und können diese anwenden.</li>\n      <li>Sie können Formatvorlagen erstellen, ändern und entsprechend einsetzen</li>\n      <li>Sie können Texte mit Tabstopps, Aufzählungen und Rahmen gestalten</li>\n      <li>Sie können mit Tabellen in Word umgehen und entsprechend einer Vorgabe gestalten</li>\n      <li>Sie können Grafiken und Illustrationen in Word einfügen und anpassen<br /></li>\n    </ul>\n    <p><strong>Hilfsmittel:</strong></p>\n    <ul>\n      <li>Lehrmittel</li>\n    </ul></div> </div> ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1347428936),(12,3,'Herbstferien','',1,'Herbstferien ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1348035122),(13,3,'Herbstferien','',1,'Herbstferien ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1348035113),(14,3,'Herbstferien','',1,'Herbstferien ',1,2,NULL,5,'a:1:{s:10:\"printintro\";i:0;}',1,1348035131),(15,3,'Auftrag Formatvorlage','',1,'Erstellen Sie in Excel eine neue Formatvorlage &quot;Resultat&quot;, die wie im nachfolgenden Bild formatiert ist:<br />