INSERT INTO `mdl_scale` VALUES (1,0,0,'Anwendung von Einzelfakten oder ganzheitliche Wissensnutzung','Nutzt Wissen über einzelne Fakten,Reflektiert das Wissen in Einzelfällen,Berücksichtigt den Gesamtzusammenhang und wägt Fakten ab','Die Skala basiert auf der Theorie von sachbezogenem, isoliertem und vernetztem, beziehungsorientiertem Denken (Belenky). Die Theorie beschreibt zwei unterschiedliche Wege, wie wir lernen und evaluieren können. <ul> <li><<strong>Getrennt/isoliert Denkende</strong> versuchen so objektiv wie möglich zu bleiben und Gefühle und Emotionen nicht zu berücksichtigen. In einer Diskussion mit anderen verteidigen Sie ihre Ideen und analysieren logisch die Ideen der anderen, um darin Schwachstellen zu finden.   </li><li> <strong>Vernetzt/beziehungsorientiert Denkende</strong> sind sehr empfindsam gegenüber anderen Menschen. Sie sind gut trainiert, Empathie zu zeigen, anderen zuzuhören und Fragen zu stellen. Sie stellen eine Verbindung zu anderen her und können sich in deren Standpunkt hineinversetzen. Sie lernen durch den Austausch von Erfahrungen und das führt sie zu dem Wissen anderer Menschen. </li></ul>',0,1675269050),(2,0,0,'Standard-Kompetenzskala','Kompetenz noch nicht vorhanden,Kompetenz vorhanden','Eine binäre Bewertungsskala, die über keine weiteren Angaben verfügt, ob Kenntnisse und Fertigkeiten unter Beweis gestellt wurden.',0,1675269050),(3,0,2,'Noten 1-6','1, 1.25, 1.5, 1.75, 2, 2.25, 2.5, 2.75, 3, 3.25, 3.5, 3.75, 4, 4.25, 4.5, 4.75, 5, 5.25, 5.5, 5.75, 6','',1,1305120182);
/*!40000 ALTER TABLE `mdl_scale` ENABLE KEYS */;
UNLOCK TABLES;

